import {Fragment} from 'react';
import classes from './Header.module.css';

import mealsImage from '../../assets/meals.jpg';

const Header = props => {
    return <Fragment>
        <header>
            <h1>React Meals</h1>
        </header>
        <div>
            <img src={mealsImage} alt='Meals'/>
        </div>
    </Fragment>
};

export default Header;
